  true,\n\t\"url\": null,\n\t\"notes\": \"<p>HRSA Geospatial Data Warehouse (HGDW):
  The HRSA Geospatial Data Warehouse (HGDW) provides a single point of access to current
  HRSA information, health resources, and demographic data for reporting on HRSA activities.
  The HGDW promotes information sharing and collaboration among HRSA staff, HRSA partners,
  health planners and policy makers, as well as HRSA stakeholders. The HGDW provides
  quick access to information that includes: - Find A Health Center - includes search-by-address
  capabilities, maps and driving directions; - Identify HRSA Grants by Key Program
  Area or State; - Locate Health Professional Shortage Areas (HPSAs) by address; -
  Identify HPSAs eligible for Medicare Physician Bonus Payment; - Locate Medically
  Underserved Areas and Population (MUA/P) groups by address; and - Locate National
  Health Service Corps Job Opportunities.  In addition, the HGDW provides the ability
  to explore data and maps that include: - Reports - traditional text-based reporting
  of the data is available in the HGDW. Users can select, sort, export and view the
  data either by spreadsheet or preformatted reports; - Maps - visually explore the
  HRSA-specific information, health resources and demographic data in geographic relation
  to one another; - Map Data Services - utilize data from the HGDW to create custom
  maps and incorporate your own data; and - Downloads - ability to download data on
  Health Professional Shortage Areas, Primary Care Service Areas, and National Sample
  Survey of Registered Nurses. The HGDW data content and functionality are continually
  evolving so a What's New page is made available.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
